import React from "react";
import MessageCard from "./messagecard";

class MessageList extends React.Component {
  render() {
    return (
      <div className="ui container">
        <MessageCard message={`eae man`} /> <br />
        <MessageCard message={`eae lok`} /> <br />
        <MessageCard message={`blz?`} /> <br />
        <MessageCard message={`blz e vc`} /> <br />
        <MessageCard message={`sereno`} /> <br />
        <MessageCard message={`eae man`} /> <br />
        <MessageCard message={`eae lok`} /> <br />
        <MessageCard message={`blz?`} /> <br />
        <MessageCard message={`blz e vc`} /> <br />
        <MessageCard message={`sereno`} /> <br />
        <MessageCard message={`eae man`} /> <br />
        <MessageCard message={`eae lok`} /> <br />
        <MessageCard message={`blz?`} /> <br />
        <MessageCard message={`blz e vc`} /> <br />
        <MessageCard message={`sereno`} /> <br />
      </div>
    );
  }
}

export default MessageList;
